[Form]
public class ProdParmStartUp extends FormRun
{
    ProdMultiStartUp                    prodMultiStartUp;
    QueryBuildRange                     parmQuery;
    PmfFormCtrl_ProdParmStartup         formCtrl;

}

void closeOk()
{
    if (prodMultiStartUp.checkCloseDialog())
    {
        super();
    }
}

void ctrlPrintButton(boolean setActive)
{
    printOptionsButton.enabled(setActive);
}

void doReselect()
{
    ProdParmStartUp  mrpParmStartUpTmp;

    select mrpParmStartUpTmp
        where mrpParmStartUpTmp.ParmId      == prodParmStartUp.ParmId    &&
              mrpParmStartUpTmp.ProdId      == prodParmStartUp.ProdId;

    prodParmStartUp_ds.executeQuery();

    if (mrpParmStartUpTmp)
    {
        prodParmStartUp_ds.positionToRecord(mrpParmStartUpTmp);
    }

    prodParmUpdate_ds.refresh(); //Update late selection checkbox
    prodParmUpdate.reread();
}

public void init()
{
    prodMultiStartUp    = element.args().caller().runbase();

    if (#PdsCatchWeightEnabled)
    {
        formCtrl = PmfFormCtrl_ProdParmStartup::constructFromForm(element);
        formCtrl.initPre();
    }

    super();

    prodParmUpdate_ds.query().dataSourceTable(tableNum(ProdParmUpdate)).addRange(fieldNum(ProdParmUpdate, ParmId)).value(queryValue(prodMultiStartUp.parmId()));

    if (formCtrl)
    {
        formCtrl.initPost();
    }

    if (#PmfEnabled)
    {
        this.pmfUpdateLabels();
    }
}

/// <summary>
/// Updates labels based on whether Production order is standard production order or batch order.
/// </summary>
void pmfUpdateLabels()
{
    ProdParmStartUp     prodParmStartUp1;
    ProdTable           prodTable;

    select firstOnly RecId from prodTable
        exists join prodParmStartUp1
        where prodParmStartUp1.ParmId  == prodMultiStartUp.parmId()
            && prodParmStartUp1.ProdId == prodTable.ProdId
            && prodTable.ProdType      == ProdType::Process;

    if (prodTable.RecId)
    {
        prodParmStartUp_ProdId.label("@PDS1470");
        prodParmStartUp_ProdId.helpText("@PDS1471");

        if (#PdsCatchWeightEnabled)
        {
            prodParmStartUp_DS.object(fieldNum(ProdParmStartUp, PdsCWStartupQty)).visible(true);
        }
    }
}

RunBase runBase()
{
    return prodMultiStartUp;
}

/// <summary>
/// Sets enabled and allowedit properties in the controls of the form based on the <c>ProdParmStartUp</c> record.
/// </summary>
protected void allowEditOnProdParmStartUpControls()
{
    if (!#PDSPotencyEnabled)
    {
        element.ctrlPrintButton(prodParmStartUp.PrintPickList);
    }
    else
    {
        boolean allowPostNow = prodParmStartUp.pdsAllowPostNow();

        prodParmStartUp_ds.object(fieldNum(ProdParmStartUp, PostNowBOM)).allowEdit(allowPostNow);
        prodParmStartUp_ds.object(fieldNum(ProdParmStartUp, bomAutoConsump)).allowEdit(allowPostNow);
        prodParmStartUp_ds.object(fieldNum(ProdParmStartUp, CompletePickListJournal)).allowEdit(allowPostNow);
        prodParmStartUp_ds.object(fieldNum(ProdParmStartUp, EndPicklist)).allowEdit(allowPostNow);

        element.ctrlPrintButton(prodParmStartUp.PrintPickList && allowPostNow);
    }

    prodParmStartUp_ds.object(fieldNum(ProdParmStartUp, DrawNegative)).allowEdit(!prodParmStartUp.ReducePhysical);
    prodParmStartUp_ds.object(fieldNum(ProdParmStartUp, ReducePhysical)).allowEdit(!prodParmStartUp.DrawNegative);
}

void init()
{
    super();

    prodParmStartUp_ds.cacheAddMethod(tableMethodStr(ProdParmStartUp, prodName));

    parmQuery = prodParmStartUp_ds.query().dataSourceNo(1).addRange(fieldNum(ProdParmStartUp,ParmId));

    if (formCtrl)
    {
        formCtrl.dataSourceInitPost(prodParmStartUp);
    }
}

void executeQuery()
{
    if (prodMultiStartUp.parmId())
    {
        parmQuery.value(queryValue(prodMultiStartUp.parmId()));
    }
    else
    {
        parmQuery.value(SysQuery::valueEmptyString());
    }
    super();

    prodParmUpdate_DS.executeQuery();
}

public void  create(boolean append = false)
{
    LineNum lineNumSave;

    if (formCtrl)
    {
        formCtrl.dataSourceCreatePre();
    }

    super(append);

    lineNumSave = prodParmStartUp.LineNum;

    prodMultiStartUp.initParmBuffer(prodParmStartUp);

    prodParmStartUp.LineNum = lineNumSave;
}

int active()
{
    int             ret = super();

    element.allowEditOnProdParmStartUpControls();

    if (formCtrl)
    {
        formCtrl.dataSourceActivePost();
    }

    return ret;
}

public void modified()
{
    super();
    prodParmStartUp_ds.object(fieldNum(ProdParmStartUp, ReducePhysical)).allowEdit(!prodParmStartUp.DrawNegative);
}

public void lookup(FormControl _formControl, str _filterStr)
{
    ProdRoute::lookupOprNum(_formControl,prodParmStartUp.ProdId);
}

void modified()
{
    super();

    if (!prodParmStartUp.ToOprNum)
    {
        prodParmStartUp.ToOprNum = prodParmStartup.FromOprNum;
    }
    if (prodParmStartUp.prodTable().QtyStUp > 0)
    {
        prodParmStartUp.StartUpProduction = NoYes::No;
    }
}

