}

void modified()
{
    super();
    element.ctrlPrintButton(prodParmStartUp.PrintPickList);
}

public void lookup(FormControl _formControl, str _filterStr)
{
    ProdParmStartUp::prodLookUp(_formControl);
}

boolean validate()
{
    Common      anyBuffer;
    ProdTable   mrpTable;
    boolean     ret = super();

    if (ret)
    {
        mrpTable = prodParmStartUp.prodTable();
        if (! mrpTable.status().runStartUp(anyBuffer,true))
        {
            ret = checkFailed(strFmt("@SYS22096",mrpTable.ProdStatus));
        }
    }
    return ret;
}

