void clicked()
{
    Args                args  = new Args();
    MenuFunction        menuFunction;

    args.record(prodParmStartUp);

    menuFunction = new MenuFunction(menuitemOutputStr(ProdPickListShowDialog), MenuItemType::Output);
    menuFunction.run(args);
}

